INSERT INTO `pages` (`id`, `category_id`, `title`, `description`, `created_at`, `updated_at`, `is_mobile`) VALUES
(20, 0, 'Privacy Policy', '<p class="p-policy-content" style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;"> </p>\r\n<p class="p-policy-content" style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">TRAVELB2BHUB.com is a registered product of B2BHUB, a Partnership Company. Here on, the term ''You'' refers to the user or viewer of TRAVELB2BHUB.com and its related tools. We value the trust you place in TRAVELB2BHUB.com, which is why we insist on the highest standards for secure transactions and customer information privacy. The purpose of this website and its related tools is to connect Travel Agents, Hoteliers and Event Planners, interested in trading with each other, but all financial transactions performed by you, due to your connections through the website are not the responsibility of TRAVELB2BHUB.com or its parent company. Besides making payments for membership to our website/App for our services (through a secure payment gateway), we strongly encourage you not to share your financial information (bank details, credit card information etc.) with any other user via emails, messages, chats, or phone calls enabled by this Website/App, and we take no responsibility for any grievances due to acts performed in that regard. Please read the following statement to learn more about our Privacy Policy:</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: ''Roboto'', sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">1. TRAVELB2BHUB.com Privacy Assurance</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">TRAVELB2BHUB.com promises that we will not sell or rent your personal information to third parties for their marketing purposes without your explicit consent. From time to time, we may reveal general statistical information about our website and visitors, such as number of visitors, number and type of services used, etc. Your trust and confidence are our highest priority. </p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">Please note that email is not encrypted and is not considered a secure means of transmitting credit card numbers. The security and confidentiality of your information is extremely important to us. We have implemented technical, administrative, and physical security measures to protect any Personally Identifiable Information from unauthorized access and improper use. Please note that despite our efforts to protect information provided to us, we cannot guarantee that such information will not be lost, disclosed or accessed by accidental circumstances or by the unauthorized acts of others. </p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">Your communications may route through a number of countries before being delivered - this is the nature of internet. We cannot accept responsibility for any unauthorized access or loss of personal information that is beyond our control.</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: ''Roboto'', sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">2. Type of Personal Information collected</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">We collect personally identifiable information (email address, name, phone number, demographic data, etc.) from every Travel Agent, Hotelier, and Event Planner who creates an account with Travelb2bhub.com. While you can browse some sections of our website and App without being a registered member, certain activities (such as placing a request or responding to a request) do require registration. We will use your contact information to send you offers based on your previous orders and your interests. We use data collection devices such as "cookies" on certain pages of the Site to help analyze our web page flow, measure promotional effectiveness, and promote trust and safety. </p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">"Cookies" are small files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer''s hard drive. We offer certain features that are only available through the use of a "cookie". We also use cookies to allow you to enter your password less frequently during a session. Cookies can also help us provide information that is targeted to your interests. Most cookies are "session cookies," meaning that they are automatically deleted from your hard drive at the end of a session. You are always free to decline our cookies if your browser permits, although in that case you may not be able to use full functionality of the Site. We only use cookies for your convenience in using the Site and not for obtaining or using any other information about you. We do not control the use of cookies by third parties.</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: ''Roboto'', sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">3. Your disclosure of your information</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">Please note that that any information you disclose in feedback, reviews and ratings with respect to your experiences in using our services, and those of the Travel Agents, Hoteliers, or Event Planners matched with you becomes public information and you should exercise caution when deciding to disclose your personal information. We may, from time to time, make links to other websites available to you; please remember that any information that is disclosed in these areas also becomes public information and you should exercise caution when deciding to disclose your personal information.</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: ''Roboto'', sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">4. Interactions with other users</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">If you transact business with a Merchant whose link or contacts originates from TRAVELB2BHUB.com or a Merchant catalog or website "presented by" TRAVELB2BHUB.com, the information you provide to that Merchant, such as your credit card number and contact information etc., is provided to the Merchant and NOT to TRAVELB2BHUB.com. TRAVELB2BHUB.com and its parent company bear no responsibility of the financial transactions between any users of this website/App. Please note that the Merchant may, if you do not specify to the contrary, share your name and postal and email addresses with third parties, including TRAVELB2BHUB. You should also know that these Merchants have their own privacy policies and data collection practices and are not covered by the TRAVELB2BHUB Privacy Policy. We do not have any control over and therefore take no responsibility or liability for these independent policies. For more information regarding Merchants appearing on TRAVELB2BHUB or other Merchants who send catalogs or host websites "presented by" TRAVELB2BHUB and their privacy policies, please see the Merchant''s website or contact them at the contact information provided on their website/catalog. Merchants that have links on the TRAVELB2BHUB site may collect personally identifiable information about you. The information practices of these Merchants are not covered by the TRAVELB2BHUB Privacy Policy.</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: ''Roboto'', sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">5. Changes to this Privacy Policy Statement</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">From time to time, we may use the information you provide us for new, unanticipated uses not previously addressed in our Privacy Policy. If our information practices change at some time in the future we will post the policy changes on the privacy page of our Website to notify you of these changes, and the revised Privacy Policy will apply to all of your personal information that we have on file, provided, however, that we will continue to honor any past requests not to share your information with third parties. You should check our Website periodically for more information on how we use the data we collect. If there is a material change in the manner we use data we collect, we will update this Privacy Policy to reflect these changes.</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: ''Roboto'', sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;"> 6. Conflict in Terms</strong></p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: ''Roboto'', sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">NOTE:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.</p>', '2017-10-23 00:00:00', '2017-10-23 00:00:00', 1),
(21, 0, 'Terms & Conditions', '<p class="p-policy-content" style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;"> </p>\r\n<p class="p-policy-content" style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">TRAVELB2BHUB.com is a registered product of B2BHUB, a Partnership Company. Here on, the term ''You'' refers to the user or viewer of TRAVELB2BHUB.com and its related tools. The purpose of this website, Apps, and its related tools is to connect Travel Agents, Hoteliers and Event Planners, interested in trading with each other, but all financial transactions performed by you, due to your connections made through the website are not the responsibility of TRAVELB2BHUB.com or its parent company. Please read the following Terms and Conditions for use of TRAVELB2BHUB.com and its related tools:</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">Eligibility</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">Use of TRAVELB2BHUB.com is available only to persons who can form a legally binding contract under the Indian Contract Act, 1872. If you are under the age of 18, you cannot be a registered member of this site, and use its related tools.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">This website/APP will serve as a B2B network that connects Travel Agents, Hoteliers, and Event Planners, within India, with each other to enable them to sell and market tourism related services better, and even in locations were they didn’t have reach or contacts. This is a B2B networking site and is NOT meant to cater directly to individual travelers.<strong style="box-sizing: border-box;">The terms of use for each category of users are as follows:</strong></p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">1) TRAVEL AGENTS:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">You, as a travel agent registered on this Portal/App, will be able connect and collaborate with other Travel Agents, Hotels, and Event Planners (currently within India) to perform the following two tasks to increase your business:</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">i. Place requests for travel requirements like Travel Packages, Hotels, or Transport for any location of your choice (currently within India), and get competitive prices from Travel Agents or Hotels, and then finalize the deal of your choice.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">ii. Respond to requests placed by other Travel Agents for Packages, hotels, or transport for the region where you have chosen to have reach and can provide good service. </p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;"><strong style="box-sizing: border-box;">Important:</strong> This is a networking site that facilitates structured interaction to enhance user experience while doing business, but facilitating and managing financial transactions like transfer of money between users is beyond the scope of this website and its tools. TRAVELB2BHUB.com and its parent company take no responsibility for the financial transactions or other commitments agreed between the users.</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">2) HOTELIERS:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">You, as a Hotelier/ Hotel’s Sales Manager once registered on this Portal/App, will be able connect and collaborate with Travel Agents, and Event Planners to sell your hotel rooms by responding to requests placed by them in real-time. </p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;"><strong style="box-sizing: border-box;">Important:</strong> This is a networking site that facilitates structured interaction to enhance user experience while doing business, but facilitating and managing financial transactions like transfer of money between users is beyond the scope of this website and its tools. TRAVELB2BHUB.com and its parent company take no responsibility for the financial transactions or other commitments agreed between the users.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;"><strong style="box-sizing: border-box;">3) EVENT PLANNERS:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">You, as an Event Planner registered on this Portal/App, will be able connect and collaborate with other Travel Agents, and Hoteliers to place requests for travel requirements like Travel Packages, Hotels, or Transport for any location of your choice (currently within India), and get competitive prices from Travel Agents or Hotels, and then finalize the deal of your choice.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;"><strong style="box-sizing: border-box;">Important:</strong> This is a networking site that facilitates structured interaction to enhance user experience while doing business, but facilitating and managing financial transactions like transfer of money between users is beyond the scope of this website and its tools. TRAVELB2BHUB.com and its parent company take no responsibility for the financial transactions or other commitments agreed between the users.</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">General Conditions:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">• The content of the pages of this website and related tools is subject to change without notice.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">• The user may register for free, but will be required to pay a nominal fixed membership fee to use certain services. The membership fee, a user pays prior to using certain services of TRAVELB2BHUB.com are nonrefundable.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">• Your use of any information or materials on this website is entirely at your own risk, for which TRAVELB2BHUB.com shall not be liable. It shall be your own responsibility to ensure that any products, services or information available through your interactions on/ via this website meets your specific requirements.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">• The contents of this website are a property of TRAVELB2BHUB.com and its parent company, and are protected by copyright laws. </p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">• B2BHUB (including its directors, officers, employees, agents and their respective successors, heirs and assigns) shall not be or deemed to be responsible or liable for any direct, indirect, punitive, incidental, special, or consequential damages arising out of, or in any way connected with, your access to, display of or use of this Website or for any lack or deficiency of services provided by any user of this website.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">• We value your privacy, please review our Privacy Policy before accepting our Term and Conditions for use of TRAVELB2BHUB.com.</p>\r\n<p style="text-align: left;"><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">Contact Us:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: left;">We appreciate your feedback, please feel free to send any questions, comments regarding this website and its related tools to contactus@travelb2bhub.com.</p>', '2017-10-23 00:00:00', '2017-10-23 00:00:00', 1),
(22, 0, 'FAQs', '<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="panel with-nav-tabs panel-default">\r\n<div class="panel-heading">\r\n<ul class="nav nav-tabs">\r\n<li class="active"><a href="#travel_agent" data-toggle="tab">Travel Agent</a></li>\r\n<li><a href="#event_planner" data-toggle="tab">Event Planner</a></li>\r\n<li><a href="#hotelier" data-toggle="tab">Hotelier</a></li>\r\n</ul>\r\n</div>\r\n<div class="panel-body">\r\n<div class="tab-content">\r\n<div id="travel_agent" class="tab-pane fade in active">\r\n<p><strong>Q1. Do I really pay NO commission to TravelB2BHub for connecting me to Buyers/ Sellers?</strong></p>\r\n<p><strong>Ans.</strong> Yes, TravelB2BHub does not charge any commission despite the value of the transaction.</p>\r\n<p><strong> Q2. Does this portal/App have an inventory management system (API based) that provides leads of Travel Packages, Hotel Rooms, or Transportation Services to Travel Agents?</strong></p>\r\n<p><strong>Ans.</strong> No, TravelB2BHub serves as a B2B network that directly connects Travel Agents with suppliers (other Travel Agents, DMCs, Tour Operators, or Hoteliers) based on the destination of the requirement. It allows added flexibility in negotiating deals, and in reaching locations where users didn’t have contacts. It speeds up the process of searching and negotiating deals by providing an organized step-by-step process to users.</p>\r\n<p><strong>Q3. What are the steps taken to ensure that the businesses listed on TravelB2Bhub are bona fide businesses?</strong></p>\r\n<p><strong>Ans.</strong> Each user with a profile on TravelB2BHub is required to provide their Company PAN Card details, Photographs of their office/ Hotel, Shop Act/ Registration, and Certificates. Users can view the percentage completeness of each other’s profile to assess the veracity of the other party. After existing on the portal/App for some time, each user will have a transaction history, rating and reviews which will be visible to other users.</p>\r\n<p><strong>Q4. Do I get charged if no one responds to my request?</strong></p>\r\n<p><strong>Ans.</strong> No, you will not be charged if you close your request before any response is received on it.</p>\r\n<p><strong>Q5. Do I get charged for responding to a request placed by others? </strong></p>\r\n<p><strong>Ans.</strong> No, even if you use up your quota of requests you will still be able to respond to requests by other users for the entire term of 1 year starting from the date you purchased your membership</p>\r\n<p><strong>Q6. I own a Travel Agency, do I need to create multiple Usernames for my employees?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub provides you the flexibility to allow all your employees to login to the portal/App using a single Username. However, you can create multiple accounts if you like.</p>\r\n<p><strong>Q7. What if I use up my quota of requests and want to place more requests?</strong></p>\r\n<p><strong>Ans.</strong> You may simply purchase more by renewing your membership.</p>\r\n<p><strong>Q8. Does TravelB2BHub provide services of transferring funds between the parties connecting on the website/App to buy and sell services?</strong></p>\r\n<p><strong>Ans.</strong> No, this platform is strictly to connect businesses interested in buying and selling services related to the tourism industry. Financial transactions are the responsibility of parties involved and must be carried out using their own money transfer methods.</p>\r\n<p><strong>Q9. What if someone doesn’t uphold the terms of negotiations that he agreed on?</strong></p>\r\n<p><strong>Ans.</strong> We have a Reviewing/ Rating functionality available for you to rate the quality of your interaction with the other party that will be visible to all the users. Also, you may Block a user if the interaction is below normal business expectations. TravelB2BHub will monitor all the Blocked users and remove any repeat offenders from the website. Credibility is the key to long term business relations and we hope that businesses listed on this website will uphold that expectation.</p>\r\n</div>\r\n<div id="event_planner" class="tab-pane fade">\r\n<p><strong>Q1. Do I really pay NO COMMISSION to TravelB2BHub for connecting me to Sellers?</strong></p>\r\n<p><strong>Ans.</strong> Yes, TravelB2BHub does not charge any commission despite the value of the transaction.</p>\r\n<p><strong>Q2. Does this portal/App have an inventory management system (API based) that provides leads of Travel Packages, Hotel Rooms, or Transportation Services to Event Planners?</strong></p>\r\n<p><strong>Ans.</strong> No, TravelB2BHub serves as a B2B network that directly connects Event Planners with suppliers (Travel Agents, DMCs, Tour Operators, or Hoteliers) based on the destination of the requirement. It allows added flexibility in negotiating deals, and in reaching locations where users didn’t have contacts. It speeds up the process of searching and negotiating deals by providing an organized step-by-step process to users.</p>\r\n<p><strong>Q3. What is the region of operation of this portal/App?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub is an ALL INDIA Network designed to directly connect Event Planners with TRAVEL AGENTS (DMCs, TOUR OPERATORS etc.), and Hoteliers.</p>\r\n<p><strong>Q4. What are the steps taken to ensure that the businesses listed on TravelB2Bhub are bona fide businesses?</strong></p>\r\n<p><strong>Ans.</strong> Each user with a profile on TravelB2BHub is required to provide their Company PAN Card details, Photographs of their office/ Hotel, Shop Act/ Registration, and Certificates. Users can view the percentage completeness of each other’s profile to assess the veracity of the other party. After existing on the portal/App for some time, each user will have a transaction history, rating and reviews which will be visible to other users.</p>\r\n<p><strong>Q5. Do I get charged if no one responds to my request?</strong></p>\r\n<p><strong>Ans.</strong> No, you will not be charged if you close your request before any response is received on it.</p>\r\n<p><strong>Q6. I own an Event Planning company, do I need to create multiple Usernames for my employees?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub provides you the flexibility to allow all your employees to login to the portal/App using a single Username. However, you can create multiple accounts if you like.</p>\r\n<p><strong>Q7. What if I use up my quota of requests and want to place more requests?</strong></p>\r\n<p><strong>Ans.</strong> You may simply purchase more by renewing your membership.</p>\r\n<p><strong>Q8. Does TravelB2BHub provide services of transferring funds between the parties connecting on the website/App to buy and sell services?</strong></p>\r\n<p><strong>Ans.</strong> No, this platform is strictly to connect businesses interested in buying and selling services related to the tourism industry. Financial transactions are the responsibility of parties involved and must be carried out using their own money transfer methods.</p>\r\n<p><strong>Q9. What if someone doesn’t uphold the terms of negotiations that he agreed on?</strong></p>\r\n<p><strong>Ans.</strong> We have a Reviewing/ Rating functionality available for you to rate the quality of your interaction with the other party that will be visible to all the users. Also, you may Block a user if the interaction is below normal business expectations. TravelB2BHub will monitor all the Blocked users and remove any repeat offenders from the website. Credibility is the key to long term business relations and we hope that businesses listed on this website will uphold that expectation.</p>\r\n</div>\r\n<div id="hotelier" class="tab-pane fade">\r\n<p><strong>Q1. Do I really pay NO COMMISSION to TravelB2BHub for connecting me to Buyers?</strong></p>\r\n<p><strong>Ans.</strong> Yes, TravelB2BHub does not charge any commission despite the value of the transaction.</p>\r\n<p><strong>Q2. Does this portal/App function as an inventory management system (API based) that provides leads of Hotel Rooms to Travel Agents, DMCs, or Tour Operators?</strong></p>\r\n<p><strong>Ans.</strong> No, TravelB2BHub serves as a B2B network that directly connects buyer with suppliers (Hoteliers, Travel Agents, DMCs, Tour Operators) based on the destination of the buyer’s requirement. It allows added flexibility in negotiating deals, and in reaching locations where users didn’t have contacts. It speeds up the process of searching and negotiating deals by providing an organized step-by-step process to users.</p>\r\n<p><strong>Q3. What is the region of operation of this portal/App?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub is an ALL INDIA Network designed to directly connect TRAVEL AGENTS (DMCs, TOUR OPERATORS etc.), Event Planners with Hoteliers.</p>\r\n<p><strong>Q4. What are the steps taken to ensure that the businesses listed on TravelB2Bhub are bona fide businesses?</strong></p>\r\n<p><strong>Ans.</strong> Each user with a profile on TravelB2BHub is required to provide their Company PAN Card details, Photographs of their office/ Hotel, Shop Act/ Registration, and Certificates. Users can view the percentage completeness of each other’s profile to assess the veracity of the other party. After existing on the portal/App for some time, each user will have a transaction history, rating and reviews which will be visible to other users.</p>\r\n<p><strong>Q5. Do I get charged for responding to a request for hotel rooms received by me on my profile?</strong></p>\r\n<p><strong>Ans.</strong> No, once you have paid the membership fee, you will not be charged any fee for responding to requests during the validity period of the membership.</p>\r\n<p><strong>Q6. I own multiple hotel properties; do I need to create different Usernames for each of them?</strong></p>\r\n<p><strong>Ans.</strong> Yes, each property must have its own profile. This will ensure that only relevant requests based on Location, Hotel Type, Price Range etc. are sent to the User.</p>\r\n<p><strong>Q7. Can I market my Hotel on TravelB2BHub?</strong></p>\r\n<p><strong>Ans.</strong> Please click on <a href="promotions">Promote your hotel</a> to find out more.</p>\r\n<p><strong>Q8. Does TravelB2BHub provide services of transferring funds between the parties connecting on the website/App to buy and sell services?</strong></p>\r\n<p><strong>Ans.</strong> No, this platform is strictly to connect businesses interested in buying and selling services related to the tourism industry. Financial transactions are the responsibility of parties involved and must be carried out using their own money transfer methods.</p>\r\n<p><strong>Q9. What if someone doesn’t uphold the terms of negotiations that he agreed on?</strong></p>\r\n<p><strong>Ans.</strong> We have a Reviewing/ Rating functionality available for you to rate the quality of your interaction with the other party that will be visible to all the users. Also, you may Block a user if the interaction is below normal business expectations. TravelB2BHub will monitor all the Blocked users and remove any repeat offenders from the website. Credibility is the key to long term business relations and we hope that businesses listed on this website will uphold that expectation.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2017-10-23 00:00:00', '2017-10-23 00:00:00', 1),
(23, 0, 'About Us', '<p class="about_first_p"><span class="dropcap">T</span>ravelB2BHub.com is a registered product of B2BHUB, a Partnership Company founded in Udaipur, Rajasthan, India. We have come together to make the Tourism business evolve and serve its clients better, by connecting Travel Agents, Hoteliers, and Event Planners to buy and sell services to each other, while paying no commission to us.</p>\r\n<div class="col-lg-4 col-md-4 col-sm-4 col-xs-12 margin-b20">\r\n<div class="icon">\r\n<div class="image"><img class="" src="/img/22.png" alt="" /></div>\r\n<div class="info">\r\n<h4 class="title">THE IDEA</h4>\r\n<p>The idea of creating this online network came to us when a Travel Agent friend complained about not being able to provide high quality service to his clients, where he didn’t have contacts. He complained how he would have to rely on disorganized and time consuming google searches, and WhatsApp groups to reach out to others to organize Travel Packages, Hotel Rooms, and Transportation, and sometimes fail.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-lg-4 col-md-4 col-sm-4 col-xs-12 margin-b20">\r\n<div class="icon">\r\n<div class="image"><img class="" src="/img/11.png" alt="" /></div>\r\n<div class="info">\r\n<h4 class="title">THE SOLUTION</h4>\r\n<p>We have created an integrated tourism trading network where Travel Agents and Event Planners can connect directly with other Travel Agents, Hoteliers, and Event Planners to sell more, and do it faster, while paying NO COMMISSION to us, regardless of the value of the sale. In addition, this network will reduce the marketing efforts of Hoteliers, by directly connecting them with Travel Agents and Event Planners.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-lg-4 col-md-4 col-sm-4 col-xs-12 margin-b20">\r\n<div class="icon">\r\n<div class="image"><img class="" src="/img/33.png" alt="" /></div>\r\n<div class="info">\r\n<h4 class="title">FUTURE</h4>\r\n<p>We are committed to make this network more efficient and more expansive, while reducing the costs of doing business, so the Hospitality Industry can grow and serve its clients better.</p>\r\n</div>\r\n</div>\r\n</div>', '2017-10-23 00:00:00', '2017-10-23 00:00:00', 1),
