(26, 12, 'Hotelier', '<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<p><strong>Q1. Do I really pay NO COMMISSION to TravelB2BHub for connecting me to Buyers?</strong></p>\r\n<p><strong>Ans.</strong> Yes, TravelB2BHub does not charge any commission despite the value of the transaction.</p>\r\n<p><strong>Q2. Does this portal/App function as an inventory management system (API based) that provides leads of Hotel Rooms to Travel Agents, DMCs, or Tour Operators?</strong></p>\r\n<p><strong>Ans.</strong> No, TravelB2BHub serves as a B2B network that directly connects buyer with suppliers (Hoteliers, Travel Agents, DMCs, Tour Operators) based on the destination of the buyer’s requirement. It allows added flexibility in negotiating deals, and in reaching locations where users didn’t have contacts. It speeds up the process of searching and negotiating deals by providing an organized step-by-step process to users.</p>\r\n<p><strong>Q3. What is the region of operation of this portal/App?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub is an ALL INDIA Network designed to directly connect TRAVEL AGENTS (DMCs, TOUR OPERATORS etc.), Event Planners with Hoteliers.</p>\r\n<p><strong>Q4. What are the steps taken to ensure that the businesses listed on TravelB2Bhub are bona fide businesses?</strong></p>\r\n<p><strong>Ans.</strong> Each user with a profile on TravelB2BHub is required to provide their Company PAN Card details, Photographs of their office/ Hotel, Shop Act/ Registration, and Certificates. Users can view the percentage completeness of each other’s profile to assess the veracity of the other party. After existing on the portal/App for some time, each user will have a transaction history, rating and reviews which will be visible to other users.</p>\r\n<p><strong>Q5. Do I get charged for responding to a request for hotel rooms received by me on my profile?</strong></p>\r\n<p><strong>Ans.</strong> No, once you have paid the membership fee, you will not be charged any fee for responding to requests during the validity period of the membership.</p>\r\n<p><strong>Q6. I own multiple hotel properties; do I need to create different Usernames for each of them?</strong></p>\r\n<p><strong>Ans.</strong> Yes, each property must have its own profile. This will ensure that only relevant requests based on Location, Hotel Type, Price Range etc. are sent to the User.</p>\r\n<p><strong>Q7. Can I market my Hotel on TravelB2BHub?</strong></p>\r\n<p><strong>Ans.</strong> Please click on <a href="promotions">Promote your hotel</a> to find out more.</p>\r\n<p><strong>Q8. Does TravelB2BHub provide services of transferring funds between the parties connecting on the website/App to buy and sell services?</strong></p>\r\n<p><strong>Ans.</strong> No, this platform is strictly to connect businesses interested in buying and selling services related to the tourism industry. Financial transactions are the responsibility of parties involved and must be carried out using their own money transfer methods.</p>\r\n<p><strong>Q9. What if someone doesn’t uphold the terms of negotiations that he agreed on?</strong></p>\r\n<p><strong>Ans.</strong> We have a Reviewing/ Rating functionality available for you to rate the quality of your interaction with the other party that will be visible to all the users. Also, you may Block a user if the interaction is below normal business expectations. TravelB2BHub will monitor all the Blocked users and remove any repeat offenders from the website. Credibility is the key to long term business relations and we hope that businesses listed on this website will uphold that expectation.</p>\r\n</div>', '2017-10-23 00:00:00', '2017-10-23 00:00:00', 1);
