(344, 2, 764, 0, 0, NULL, NULL, 'JAIPUR02', 0, 19000, '0', '2', '', '', '', '', '', NULL, '', '', 0, '0000-00-00', '0000-00-00', '2', 809, 33, 101, 'JAIPUR', NULL, 'JAIPUR', 809, 33, 101, '\r\nDay1(06/02/2018): Arrival at Jaipur Airport and proceed to Hotel.Overnight at Jaipur.\r\n\r\nDay2(07/02/2018): After breakfast drive to Pink City Sightseeing ( Amer fort, Wind Palace, Water Palace) evening proceed to Chokhi Dhani for Dinner at the theme of Rajasthani Culture.back to Hotel. Overnight at Jaipur.\r\n\r\nDay3(08/02/2018): After breakfast, Drive to Jaipur City Sightseeing( City Palace, observatory, Monkey  Temple, Albert Hall, Birla Temple).evening back to Hotel. Overnight at Jaipur.\r\n\r\nDay4(09/02/2018): After breakfast, Checkout Hotel, Drive to Udaipur via Pushkar Sightseeing (Pushkar Lake, Pushkar Village, Lord Brahma Temple) check in Hotel. Overnight at Udaipur.\r\n\r\nDay5(10/02/2018): After breakfast, drive to  Lake City Sightseeing( Jagdish Temple, Lake Pichola, Lake Palace, Boating, City Palace, Maharana Pratap imperial). Evening back to Hotel. Overnight at Udaipur.\r\n\r\nDay6(11/02/2018): After breakfast, checkout Hotel. Drive to Jodhpur via Ranakpur and Khumbalgarh Sightseeing (Ranakpur Jain Temple and Khumbalgarh fort). Check in Hotel. Overnight at Jodhpur.\r\n\r\nDay7(12/02/2018): After breakfast. Check out Hotel. Drive to Sun city Sightseeing (ClockTower, Jashwant Thada, Mehrangarh fort) Proceed to (Jaipur) catch onward Flight. \r\n', '2018-02-06', '2018-02-12', '', 0, 0, '0000-00-00 00:00:00', '2017-12-28 12:22:04'),
