(401, 329, 1104, 'Day 01 : Port Blair Arr.\r\n\r\nUpon arrival at Port Blair Airport by flight, Our representative will meet and assist you at the Veer Savarkar International Airport. Board the waiting vehicles, drive to your hotel and check in. First half of the day is at leisure. Later Proceed to sightseeing of Cellular Jail and at 6.00pm view the light & Sound show. Overnight stay at Port Blair Hotel/Resort.\r\n\r\nDay 02 : Port Blair – Neil Island\r\n\r\nAfter breakfast, proceed to Port Blair Harbour to board cruise connecting to Neil Island. Neil is a beautiful island with lush green forest and sandy beaches is the vegetable bowl of Andamans. Neil island with its very relaxed vibes and long deserted beaches is a place to chill out. On arrival at Neil Island jetty transfer to hotel. Later proceed for Neil Island sight-seeing visiting Bharatpur Beach which has a sprawling stretch of white sand and greenery with the presence of colourful coral reefs.  Later visit Sitapur Beach which is a serene seafront with natural limestone formations situated at the tip of Neil Island. Later proceed to the famous Natural Bridge at Laxmanpur Beach No. 2 where there are two living natural corals formed just like a bridge. Also visit Laxmanpur Beach No. 1 or sunset beach which is a serene white sand beach offering stunning panorama during sunset. Overnight stay at Neil Island Hotel/Resort.\r\n\r\nDay 03 : Neil Island – Havelock Island\r\n\r\nEarly morning, proceed to Neil Island jetty to board cruise connecting to Havelock Island. With Beautiful sandy beaches fringed by green canopy of rainforest, Havelock Island beckons everyone to enjoy the fun of azure blue sea. On arrival at Havelock Jetty, Transfer to Hotel, The sea here is very calm and quite shallow. Later visit to world famous Radhanagar Beach which shot to global fame when Times Magazine rated this beach as finest beach in Asia. Overnight stay at Havelock Hotel/Resort.\r\n\r\nDay 04 : Havelock Island – Port Blair\r\n\r\nAfter breakfast proceed to Elephanta beach (Optional charged Extra) in a sharing fiber speed boat, Enroute the client can go for a snorkeling session at Elephanta Beach (Snorkeling Complimentary one time). Elephanta beach offers snorkelers calm blue shallow waters and is the perfect spot for beginner snorkelers. Its also a great place to just spend time lazing on the beach. The beach is very scenic with fallen trees and white sand giving the photographer some beautiful pictures to take back home. Proceed to Havelock Jetty to board cruise to Port Blair. Overnight stay at Port Blair Hotel/Resort.\r\n\r\nDay 05 : Port Blair – North Bay (Coral Island) – Ross Island – Port Blair\r\n\r\nAfter breakfast, embark on a day long 02 island cruise (Ross Island & North Bay Island). Ross Island the erstwhile capital of Port Blair during the British regime and now stands as a ruin of the bygone days with the old structures almost in debris. North Bay (Coral Island) offers beautiful scenic view of open sea and provides lifetime experience of Snorkelling (Optional) and view of colourful rare corals and underwater marine life through glass bottom boats. Return back to Port Blair. Overnight stay at Port Blair Hotel/Resort.\r\n\r\nDay 06 : Port Blair – Wandoor Beach – Chidiyatapu – Port Blair\r\n\r\nEarly morning, proceed to the beautiful Wandoor Beach which is located 27 kms from Port Blair and is ideal for swimming and sun bathing. Later visit Chidiyatapu Island which is the southernmost tip of South Andaman Island. The lush green mangroves and forest provides shelter to numerous chirping birds and provides a perfect view during sunset. Later return back to Port Blair via Joggers Park which is situated at one of the highest point in Port Blair and provides panoramic view of the Port Blair Airport. Evening free to explore on your own or shopping.  Overnight stay at Port Blair Hotel/Resort.\r\n\r\n Day 07 : Port Blair Dep.\r\n\r\nAfter breakfast pack your baggages with a promise to return once again to this paradise…. Check-out and proceed on time to board your flight with sweet memories of your holidays. We await for your next visit … Bon Voyage. Service ends', '78000.00', 0, '2017-12-09 11:16:44', 0, 0),
