(434, 338, 1178, 'New Year special Package ????\r\nWelcome 2018 with Snow ?\r\nDates : 29th Dec 17 -1st Jan 18\r\n\r\nDestination: Shimla\r\n\r\nHotel Details:\r\nHOTEL SHIMLA HILLS INTERNATIONAL\r\n\r\nCab Details : \r\nTEMPO TRAVELER\r\n\r\nInclusions\r\nAccomodation : Hotel (3 Star) \r\nMeal plan : Breakfast & Dinner\r\nGala Dinner Dj Party Unlimited Shots 31st eve celebration party\r\n\r\nItinerary:\r\n\r\nDay 1 : DELHI TO SHIMLA BY TEMPO TRAVELER (OVERNIGHT JOURNEY -370 KMS) \r\nToday arrive in Delhi by Air or Train. Our driver will pick you up and straight drive to Shimla …(over night journey) . \r\nShimla is the capital of Himachal Pradesh and also known as the “QUEEN OF HILL STATION” \r\nDay 02 :SHIMLA LOCAL Sight Seeing\r\nToday morning reach Shimla check into the hotel fresh & up proceed to local sightseeing.it include institute of advance study, birds park,jakkhoo temple ,the mall road & ridge ..........dinner & overnight stay at hotel with bonfire.\r\n\r\nDay 3 : SHIMLA KUFRI SHIMLA\r\nMeals – Breakfast + Dinner\r\nThis day after breakfast proceed for in and around sightseeing of SHIMLA, visit KUFRI, India''s one of the best holiday paradise Kufri in Shimla is beautifully tucked on an altitude of 2,622 meter. The place is a tourist hotspot for its awesome scenic and sports activities. Evening free to stroll in the famous shopping place of Shimla town – “THE MALL& THE RIDGE” This large open space in the heart of town presents excellent views of the mountain ranges. Shimla''s landmarks - the neo- gothic structure of Christ Church and the neo - Tudor library building - are worth seeing. Overnight at hotel with welcome\r\nNEW YEAR PARTY-2018\r\nIncludes unlimited drinks ,cocktail snacks followed with gala Dinner\r\nSightseeing for the day:\r\n· Kufri\r\n· Green Valley\r\n· Chini Bungalow\r\n\r\nDay 4 : SHIMLA TO DELHI \r\nMeals-Breakfast\r\n\r\nAfter breakfast, Hotel''s check out time is 1200 noon.Our driver will give you a final drop to Delhi ..............TOUR ENDS WITH SWEET MEMORIES\r\n\r\nPrice : 8499/-pp \r\n(On twin sharing )\r\nCouple : 7999/-pp\r\n\r\nThanks & Regards\r\nESHITA \r\n09873076181', '8499.00', 0, '2017-12-22 15:34:00', 0, 0),
