(299, 'G.K.Mageshwaran', 'Kumar', '$2y$10$vV8hJ4BU8V9MEirIQvkIfOPBfUaMvIBj4sqKRnWkI2Rtn/.O9ez1C', '9043297922', '9600065265', '', 'tourjollyholidays@gmail.com', 1, 'Jolly Holidays', '', '', '', 'No,38 Rajaji Street, Tambaram (West)', '', 101, 882, 35, 1, '2017-09-23 10:34:31', 'ABOUT US\r\nJolly Holidays started in the year 2000, as a specialized Tour Operator for Domestic & International. We have offices in Bangalore, Chennai, Thailand, Singapore, Malaysia, Dubai, Maldives, and Mauritius and also we are coming up with more offices in other countries. The Travel Planners has grown to become one of the leading and most respected operator recognized by Ministry Of Tourism,. We are the fastest growing Tour Company with the mission of providing unique tours and are best known for our personalized and professional tour services.\r\nOur team of adept professionals strives to offer you the best suited tour packages for all your travel needs and requirements. The entire range is also offered in customization with your specifications to make sure each of your travel dreams is accomplished. Moreover, our tour experts keep in touch with you throughout your sojourn to make sure that you bask an experience like never before with us.\r\nWe fully understand that your satisfaction is our key to success and thus keep on striving to add up some of the undiscovered destinations that you can head on to and take a break from your monotonous life. Our transparent business policies and fair dealings ensure full customer satisfaction. Furthermore, each of the offered tour packages is 100% reliable and credible and thus ensures your satisfaction at each and every step.\r\nWith us, each of the getaways will be a lifetime experience that you will relish for the rest of the time of your life!!\r\nFinancial security - We provide complete financial security for all our clients and adhere to all government regulations concerning the safety of our clients'' money.\r\n\r\nResponsible tourism - We run all our trips in as responsible manner as possible, socially, culturally, economically and environmentally.\r\nQUALITY POLICY\r\n" The Travel Planners is committed to provide high quality travel solutions which meet and exceed our customer expectations... "\r\n\r\nThis is achieved by:\r\nProviding reliable, prompt, consistent and customer friendly quality services\r\nWell qualified and experienced staff to deliver best service\r\nSatisfaction\r\nWe rely very heavily on word of mouth and repeat custom for our bookings, consequently it is imperative that we give our clients the best holidays possible. We believe that over 16 years of operation and a more extensive programme than anyone else in our corner of the travel industry illustrates our success\r\nBest Regards,\r\nLion.G.K.Mageshwaran, MBA                                 \r\nDirector-Sales\r\nWhatspp: +91 9043297922\r\nM: +91 9962000566, 9600065265\r\nJolly Holidays         \r\nwww.jollyholidayss.com\r\nwww.jollyholidays.org\r\nwww.facebook.com/jollyholidayss\r\nNo - 38, Rajaji Road, West Tambaram - Chennai-600045\r\nAssociates Offices – India/Bangkok/Singapore/ KualaLumpur /Colombo/ Maldives /Mauritius\r\n\r\n', NULL, 'Tambaram', '600045', '1,11,15,17,19', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', ''),
