(307, 'Kapil', 'Gulati', '$2y$10$pElhfO0dOYqC8x497g8Jcuq633EaDb64H.yTxnlelKiTKtKzMC8Zm', '9910369969', '9871356300', '', 'saiindiatravel@gmail.com', 1, 'Sai india travel', '', '', '', 'F 7 kalkaji', '', 101, 204, 10, 1, '2017-09-24 13:13:50', 'SAI INDIA TRAVEL- "A Complete Destination Management Company "offers everything a visitor ever asks for. At SAI, our client’s satisfaction is our aim. We are adaptable to our client’s needs and requests.\r\nWith efforts from our young, dedicated and enthusiastic team, we have explored unknown and undiscovered areas, opened new vistas and experimented with various activities in order to specialize in vast range of adventure ,Cultural tours, Spiritual, Beach ,Medical and many more. You do not have to worry about your accommodation, meals, air/rail ticket; you can just leave it to us and enjoy a stress free vacation..\r\nSAI INDIA TRAVEL has always endeavoured to make the best Tour Packages and itineraries for our Tourists.\r\nIn short, the following are a few features that distinguish us from the rest:\r\nFixed and customized travel packages (INDIA/NEPAL/BHUTAN ).\r\nBudget to High quality tours.\r\nProfessional assistance at all stages of your travel.\r\nComplete client satisfaction.\r\nHotel accommodation( Budget class to Luxury class).\r\nBest Transportation facilities.\r\nBest approved guides\r\nYour comfort is our priority.\r\nSAI INDIA TRAVEL has been approved by Government of India, Ministry of Tourism and also a member of IATO ( Indian association of Tour Operators ).\r\n', NULL, 'KALKAJI', '110019', '10,11,22,33', 1, '1506403099818444077.jpg', NULL, '1506403099945068059.jpg', NULL, NULL, '15064030992063044407.jpg', NULL, NULL, '', NULL, 'WWW.SAIINDIATRAVEL.COM', NULL, '', '', '150640309967237187.jpg', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', ''),
