(330, 'MANISH', 'GALUNDIA', '$2y$10$ZHqbAdYgBvaejgpGP.v6be3gyaO2U6zcgcR0GLZt/CK0Upek1QiA6', '9414166881', '02942488881', '', 'reservation@hotelgorbandh.com', 1, 'HOTEL GORBANDH', '', '', '', '138-138A, INSIDE UDAIPOLE, UDAIPUR', '', 101, 877, 33, 3, '2017-09-25 06:45:49', '“HOTEL GORBANDH”  needs no introduction to the elite class of the city and your good selves, we being one of the oldest and impeccably reputed hotel unit, are established in the centre of the city just near to famous Gulab Bagh Garden .The central location makes it a best choice not only for the business travelers but also for the tourist due to its easy accessibility to the market and to various tourist spots. The Hotel is a First class budget priced hotel with all the modern amenities.\r\n\r\nWe feel ourselves admired to offer services of our homely hotel being authorized hotel of your company. We shall be highly obliged to attend your dignified guest who might be visiting Udaipur from all over India and aboard throughout the year. \r\n\r\n•	Hotel is situated near central bus stand, 1 Km from railway station & 22 Km from airport.\r\n•	Hotel has 22 tastefully decorated rooms that are well equipped with modern amenities like electrical tea/coffee kettle, led tv., direct dialing, satellite television, hot & cold water ………Other facilities are A.C conference hall, Restaurant, Car parking, Lift, Generator backup.\r\n•	Major international and domestic credit cards are accepted on on-line booking.\r\n', NULL, 'UDAIPOLE', '313001', NULL, 1, '15063233801190337216.JPG', '1506323380702925139.jpg', '1506323380232332707.JPG', '1506323380967779993.JPG', '15063238151990100984.jpg', '1506323380195297645.jpg', NULL, 2, '', '1', 'www.hotelgorbandh.com', NULL, '', '', '', '', '', '', '', '2017-09-25 06:55:38', '0000-00-00 00:00:00', '', ''),
