(418, 'Laxman Singh', 'Bisht', '$2y$10$j.sNaSN8wUf34DDyV22asOCkTgKWNU085Vjfb4lOgqBrtZKa8/BwO', '9205107743', '9560480230', '', 'info@eholidays.in', 1, 'Eholidays', '', '', '', 'C74 mahavir vihar-dwarka sector 1', '', 101, 204, 10, 1, '2017-09-30 19:08:13', 'Eholidays is a leading travel & tour planning company based in Delhi . Eholidays has been established by a group of experienced Professionals with a deep knowledge of the hospitality industry. \r\n\r\nEholidays is the first tourism site which cater all tourism needs under one roof . At Eholidays offers exotic and comprehensive range of holiday packages. Our skilled and experienced holiday experts design and execute the holiday in the most professional way. We have been widely acclaimed for custom designed and tourist friendly tour arrangements. \r\n\r\nAll the efforts and initiative of the company rotate around the travelers and the soul goal of the company is to intensify your travel experience with the top quality services. We work as a travel guide for you available any time with the complete travel information that is reachable from any part of the world. \r\n\r\nIf you’re looking for a fantastic holiday then look no further. At Eholidays, we’re proud to bring you great holidays at great prices. Whether you fancy a luxury All Inclusive retreat in Singapore, exploring the Romantic and ancient sites of India or a fun-filled beach holiday in Pattaya, you’ll be able to choose from our huge range of holiday packages which are designed to suit every budget\r\n\r\n\r\nAt Eholidays we make your holidays Ezee while taking all your travel and accommodation related responsibilities on us. We provide facilities such as hotel booking, flight booking, Volvo booking, and car packages and in complete holiday packages at your door step within few hours.\r\n\r\n\r\nWe work according to you because to attain you is our target. we really have got all of your travel needs covered. So what are you waiting for? Come and find your next great value escape with Eholidays. \r\n\r\nBook with us in just some simple steps:\r\n\r\n\r\nFill up your complete requirement through our website or mail us to our mail id provided on our website. Our representative will call you or you can call to our travel agent. \r\nChoose one of the best plan according to the requirement and budget. ', NULL, 'Mahavir vihar', '110045', '11,14,19,39', 0, '1507111625113496589.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, 'http://eholidays.in/', NULL, '', '', '', '', '', '', '', '2017-10-04 09:49:38', '2018-01-17 07:03:32', '77cd3e2eb9caf4293ae64e1d6adbf76393cb24d0', ''),
