(531, 'Bhawna', 'Raman', '$2y$10$Ds4aOc9Mqfq5S74Ri9aJJegFqnLC7YFaLKLgcNv2vqxQ0SSaq/Tjy', '7544001107', '9204752102', '', 'marketing@maurya.com', 1, 'HOTEL MAURYA', '', '', '', 'South Gnndhi Maidan', '', 101, 159, 5, 3, '2017-10-14 11:31:13', 'We proudly introduce the only five star hotel in Patna “Hotel Maurya’.\r\n\r\nWhile envisioning this dream we ensured it was ideally located with a magnificent view. Just a 20 minutes’ drive from the airport & 10 minutes from the railway station, this premier hotel is situated in the heart of Patna with a beautiful view of Gandhi Maidan and an easy access to most of the business houses/hub and destination.\r\n\r\nHotel Maurya, Patna having a legacy of 40 years brings to you a bouquet of grandeur.\r\n\r\nWe have 77 well-appointed rooms with premium lifestyle amenities and world class services to cater to the high rising demands of the upcoming corporate industries in Bihar. It has 04 elegantly designed Suites which will make it the highly preferred destination for our elite guests.  \r\nIt brings to you all the state of the art facilities like the Business Center, In house Travel Assistance, Wi-Fi hi-speed Internet Access, Express laundry Service, a Restaurant – Spice Court; Coffee shop – Vaishali Café, Lounges– Club & Club Premier Swimming Pool, Gym & Shopping Arcade. Other value added services include round the clock In-room dining, Doctor on call, Electronic Safety Locker, Mini Bar with Non-alcoholic Beverages, Direct outward dialing, and Satellite TV. For all your conferencing, private functions, get-together or meeting needs there are seven Banquet Halls plus Swimming Pool Area ready to host from 25 to 1000 people at one time.\r\n', NULL, 'Gandhi Maidan', '800001', NULL, 1, '1508153392669787443.JPG', '15082253731392945217.JPG', '1508153393600037143.JPG', '15081533931817403316.png', NULL, '15082264381937386606.jpg', NULL, 5, '', '1', 'www.maurya.com', NULL, '', '', '', '', '', '', '', '2017-10-14 06:30:49', '2017-10-17 12:54