(556, 'Samar Vijay', 'Singh', '$2y$10$YZQntSWPlLRdgeRD9yMICuee5lb.motlqbet261I18zmnOSbR.S/u', '8875555775', '9772433334', '', 'info@udaikothi.com', 1, 'Udai Kothi', '', '', '', 'Udai Kothi,, Hanuman Ghat Opp. Chand Pole, on Pichola Lake, Udaipur, 313001, Rajasthan, India', '', 101, 877, 33, 3, '2017-10-16 15:33:44', 'Though within a short, pleasant stroll from the heart of old city, Udai Kothi is remarkable for its tranquility and magnificence. Conceptualized, designed, created and run by Kunwar Vishwavijay and his wife Bhuwneshwari Kumari, Udai Kothi is a superbly modern hotel, which pampers you with all the facilities, amenities and luxuries a 21st century traveler expects. While Udai Kothi is modern at heart, the owners have made every effort to incorporate all those architectural and decorative features that make living in the city of Udaipur a pleasure. Udai Kothi offers guests the best of both worlds; the latest standards, blending happily with old-world charm. Udai Kothi has 64 well-appointed Luxury Rooms & Suites with International Amenities & traditional decor. \r\nThe elegant rooftop restaurant with its cool palm court makes a perfect retreat the midday heat. Dine in the evening in a romantic ambiance, muted lighting, gentle music, shining cutlery and spotless napery. The reflection of the illuminated palaces in the waters of the lake and the twinkling lights of the city won’t fail to enchant you. We offer a high standard of cuisine form a comprehensive menu.\r\n \r\nUpon the terrace discover a perfect spot to relax, or swim in Udaipur’s only rooftop pool; away form the noise and bustle of the city street with the restaurant close-at-hand to supply you with drinks, snacks or meals, and musical entertainment in the evening.\r\nEach guestroom has its own character and style, with carefully selected furniture, soft furnishings and décor; and a delightful view that can be savored form the jharokha (window seat). Spacious lawns stretch out on the South side of the hotel, bordered with multicolored climbing Bougainvillea and other beautiful shrubs and flowers, an ideal venue for large celebrations.', NULL, 'Udaipur (Rajasthan)', '313001', NULL, 1, '15111595531562686878.jpg', NULL, '15111595531747132156.jpg', '1511159553989795344.jpg', NULL, NULL, NULL, 4, '', '2', 'http://www.udaikothi.com/about.html', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '2017-11-26 03:43:45', '', ''),
