(581, 'Shilpa', 'S', '$2y$10$IlHgf6Xo0swO7UoRYrdQkuEzqZtUnT3Jj/Q.sE8.dKGWvFEjbCx5S', '8086666799', '7356579443', '', 'info@pickmyholiday.com', 1, 'Pick My Holiday', '', '', '', 'Moopans Building,', '', 101, 441, 19, 1, '2017-10-20 22:59:17', 'PickMyHoliday is a prime facilitator based in Alleppey, who makes your Kerala tour easy, hassle-free, and most affordable. We have a team of professionals who make Gods own country, Queen of Malabar Coast tour as one of the most wonderful, enticing, enthralling, and memorable holiday destination for your family and friends. Kerala with the calm Arabian Sea on one side, lush green Western Ghats on the other, lovely beaches on the coast, with many canals all over the state, PickMyHoliday makes sure that this charming holiday gives a thrilling yet memorable experience to its visitors.\r\n\r\nKerala boasts of its rich heritage, culture and natural offerings. PickMyHoliday is the right partner to plan your perfect Kerala trip which offers many options like backwaters for nature lovers, pilgrim centers, hills, lush green fields, vast serene beaches, palm groves, wildlife, boathouse stay, bamboo rafting, Village tours, museums, palaces, monuments, waterfalls and much more.\r\n\r\nBlessed with a pleasant weather, Kerala is one of the few holiday destinations that can be visited throughout the year. PickMyHoliday helps you to choose a right package in the multiple options Kerala offers. PickMyHoliday suggests that the best time to visit this magical abode with your family for a leisure and fun holiday is from September to March. In this time, the cool weather enhances the beauty of Kerala. PickMyHoliday makes this time is equally befitting time for honeymoon couples to fill their lives with romance and love in this fantastic place.', NULL, 'Alleppey', '688007', '19,35', 1, '15085210341967529879.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, 'https://www.pickmyholiday.com/', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '2017-10-20 11:03:44', '', ''),
