(737, 'RESHMA ', 'V Y ', '$2y$10$dzOdEduZnT9xbFlsFK4Xy.mVL5.9iYSzxw8CPdxd41UYgDMGCv0qK', '8129376708', '9946145631', '', 'cheraibeach1234@gmail.com', 1, 'HEAVEN IN CHERAI', '', '', '', 'cherai beach  vypinislsnd cochin  kerala  india', '', 101, 473, 19, 3, '2017-11-10 10:07:29', 'Heaven is a home stay which is located near Cherai beach. Cherai beach one of the finest beach in the world. The Cherai Beach is located at the Gateway of Muziris, the heritage capital of Kerala, 25 kms from Cochin International Airport and 25 kilometer from vibrant city Cochin, the oldest European settlement in India. There are plenty of taxis & tuk tuk available for your onward journey\r\n\r\nHeaven is a place you are looking for to spend your holidays. We provide even better facility you cannot receive even at your home. It have four Bedroom with attached modern shower room . A/C , NON A/C rooms available here. All the room size are standard and well furnished .en suite shower room always neat and clean. In front of the property nothing constructed it means you will get the nice view and easy access to the sea . surrounding area is beautiful with pine trees. Always you will get nice sea sound and breeze. We look forward to welcoming you to our Heaven', NULL, 'Cochin', '683514', NULL, 1, '1510407354123590132.jpg', '15102897141750425477.jpg', '15102897141638887163.JPG', '1510289714805799111.JPG', '15104073541485593200.pdf', NULL, NULL, 1, '', '8', 'www.beachinkerala.com', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '2017-11-11 07:01:26', '', ''),
(738, 'lalit', 'sharma', '$2y$10$GECknFjtUqqDcPeuUrzGC.B5BXylSsaMR3RXXO8N93WUv5oi2dAMG', '9873431743', '', '', 'lalits808@gmail.com', 0, 'Shree Girirajji tour& travels', '', '', '', 'C-63 vijay vihar phase-2,near sector-4,new delhi -110085', '', 101, 204, 10, 1, '2017-11-10 12:49:16', '', NULL, 'rohini', '110085', '10', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', ''),
(739, 'Vishal', 'Sood', '$2y$10$ivLBOvgnFfHihlp9jyD9puQXHeD0jKQaW4aUUJ9h0BfwrMiomzfIq', '9822584560', '8322272138', '', 'vishal@jabudays.com', 1, 'Little Siolim', '', '', '', 'Little Siolim, House no 27/1, Afframent Vadi, Aguada - Siolim Road, Siolim Village', '', 101, 1268, 11, 3, '2017-11-10 13:13:18', 'Little Siolim Villa is conveniently situated on a hill slope as you enter the village of Siolim. The villa is available exclusively for a group of up to 8 guests using 3 bedrooms or even a couple who only utilize a single bedroom. At Little Siolim we charge by the number of guests staying and not for the entire villa as a whole. So if you''re only 2 of you wanting to spend a romantic weekend at Little Siolim, pay for only 2 people and use the villa exclusively. \r\n\r\nLittle Siolim has been designed from two 100 year old Portuguese houses that have been combined to form one house. Little Siolim is inspired by Siolim House and created by the same family (Little Siolim is owned by the younger brother). It gives guests the experience of living in an ancient house with the comforts of a modern home. The architecture and design is an amalgamation of Portuguese, Sri Lankan and South East Asian designs created by the owner himself.\r\n\r\nThe swimming pool set in the courtyard of the house offers a private experience of swimming while gazing at the spectacular view of the stars. The entire house centers around the pool as the living room and the 3 bedrooms are situated around it. The pool continues into the living room inviting you to take a dip at any time. The living room also has an open kitchen which is fully equipped with all modern amenities for cooking up that delicious meal. You can choose to cook yourself or opt for a cook which is available on request. On the other side is a verandah which overlooks the side garden. The entire property is surrounded by gardens / open spaces on 3 sides along with a patio in the front of the house; another place to enjoy that cup of local tea. The entire house has high ceilings, including the bedrooms, and all rooms are air conditioned and have cable TV. The master bedroom has a four poster bed and a large en-suite bathroom with a romantic bathtub for 2 made from terrazzo. The master bedroom also includes a private garden and veranda. Bedroom 2 is furnished with teak wood furniture including a boat shaped bed imported from Bali and supports a flower power kind of theme to its design. Bedroom 3 with a direct view of the pool has a unique outdoors bathroom which includes an open-to-sky shower. This bathroom also contains the original well of the house and still operates today as a source of water for gardening. This bedroom has been designed with a Zen style to it. \r\n\r\nThe theme of Little Siolim is Mangoes and Coconuts which is why the house is painted a rich yellow and the pillars lining the veranda and pool are all made of coconut tree wood. The perimeter of the house is lined with coconut trees and the garden includes lavish fruit bearing mango trees. Little Siolim is the perfect place to have an exotic retreat or romantic getaway. You can enjoy your morning breakfast (included) facing the garden at the side of the house or in the front of the house where you can watch the world go by. The house can comfortably fit anywhere from six to eight guests. Our staff is very warm and friendly and will make sure that your stay at Little Siolim and Goa is the perfect get-away.', NULL, 'Siolim', '403517', NULL, 1, '15103001491809804181.jpg', NULL, '1510300149921586406.jpg', '15103001492092564379.jpg', NULL, NULL, NULL, 4, '', '9', '', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '2017-11-21 08:11:23', '', ''),
