(777, 'Brer', 'A', '$2y$10$EbA7wlc/QPITOtKnPLf0buIuWXxwgunAVQL3sdFCX2rZDGl061ZH.', '9408242468', '9724280408', '', 'brergroup@gmail.com', 1, 'Gateway To Kutch', '', '', '', 'Near H P Petrol Pump, Vill : Palara, Bhuj White Rann Road', '', 101, 217, 12, 3, '2017-11-13 13:33:21', 'Welcome to Gateway To Kutch Resort. The village resort is built near Bhuj White Rann of Kutch Road. At Gateway To Kutch Resort, we have Kutchi Cottages (mud hut), all well traditional crafted with interior mud work, both AC & NON AC Cottage along with Tents with all facilities.\r\n\r\nCloser your eyes and imagine the utter emptiness. A white nothingness – a brilliant, frost colored land – fat as an ice lake, burning the eyes with its whiteness. Not a bump, not a shrub, not a bird, not a breeze. Nothing but white every direction, horizon after horizon, on and on for over two hundred miles east to west, and almost one hundred miles north to south.''', NULL, 'Bhuj', '370001', NULL, 1, '1510564230213041749.jpg', '15105642301815978038.jpg', '1510564230199405166.jpeg', '1510564230133226199.jpeg', '1510564230174651097.jpg', NULL, NULL, 3, '', '10', '', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '2017-11-13 02:33:07', '', ''),
