(779, 'Megha', 'Kochhar', '$2y$10$oCcOxyRGyliOnFuR2aObRenegsWuyoRQTOWjzyVwYpKer5DVi8C6q', '9816076512', '9910170312', '', 'sales@willowbanks.com', 1, 'Hotel Willow Banks', '', '', '', 'hotel willow banks, the mall shimla, near tourism lift', '', 101, 321, 14, 3, '2017-11-13 18:54:40', 'Built on a heritage and landmark estate, Willow Banks - originally owned by James Craddock Jr., known as the ‘Architect & Builder of Shimla’ - effortlessly blends into the surrounding landscape enhancing its beauty. Centrally located with easy accessibility to numerous attractions in Shimla, this hotel in Shimla can be conveniently reached from the Tourism Lift, Cart road parking and High court parking. With tastefully designed spacious rooms near Mall Road Shimla fitted with modern amenities; the rooms offer breathtaking views of lush green mountains and age old pines while overlooking the entire town of Shimla.\r\n\r\nWith the two in-house eateries rated as top restaurants in Shimla on Tripadvisor – Café Simla Times and Eighteen71 Cookhouse & Bar – the hotel offers the best eating experience in Shimla.\r\n\r\nFor a complete Himalayan rejuvenation experience in Shimla, visit Akasa Spa, the beauty salon and the gym or drop by at the billiards and pool room at leisure. Personalized hotels service in Shimla and dedicated hospitality of the hotel promises you a truly memorable holiday in Shimla.', NULL, 'the mall road', '171001', NULL, 1, '15106463681352324621.jpg', NULL, '1510646368451454446.jpg', '1510646368289774596.jpg', NULL, NULL, NULL, 4, '', '2', '', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '2017-11-14 01:21:38', '', ''),
