(840, 'Rajesh K', 'Verma', '$2y$10$7Fdgah.1/w2vp3YkMqdQP.LIv1FhJheo4Bfr52JVe8l.SaIxF5cE6', '9911887751', '9810048879', '', 'Sagaradventure2017@gmail.com', 1, 'SAGAR ADVENTURE', '', '', '', '18/ 76 UGF street No 1 East Moti bagh  Near Shastri nagar Metro Station', '', 101, 204, 10, 1, '2017-11-16 19:40:22', 'Sagar Adventure is having main office in Delhi India, the company was established in 2015 with the object of furthering the cause of an indigenous travels agency, It has grown into a pioneering tour operating agency. Today, after one year of distinguished service in tour operations, Sagar Adventure has emerged as a leader among tour operators. We offer a variety of tours that display the amazing diversity of India including its tradition, language, dress, cuisine, and life style that vary from state to state. The company''s core activities are inbound tourism, domestic and leisure travels & corporate travels & specialized department to organize and handle meetings, hotel reservations, train bookings & car rentals...\r\nWhy Choose Sagar Adventure \r\n\r\nSagar Adventure Tours you will find a team of dedicated professionals, each contributing their optimum expertise to deliver and ensure complete satisfaction of our clients. Our young team of tour planners and designers, expert tour organizers and professional tour guides who speak Spanish , French & Italian language together with our friendly staff members, strive to give the guests an authentic and rich holiday experience.', NULL, 'East Moti Bagh ', '110007', '10,14,19,33,39', 1, '15109437191270151952.jpg', NULL, '15109437191715261834.jpg', '1510943830630379742.jpg', NULL, '15109437191590679615.jpg', NULL, NULL, '', NULL, 'www.sagaradventure.com', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '2018-01-08 11:45:23', '', ''),
