(928, 'Dinesh ', 'Singh ', '$2y$10$d4XUQmjcTMUxt7fU/eqRFuq5VXHT7A5nDOWhzQ3gqww4fCsid2Qgu', '9915683639', '9501611333', '', 'dineshsingh78@hotmail.com', 1, 'Savrupson Heritage Home ', '', '', '', '2 Savrupson House, Model Town Mithapur Road ', '', 101, 762, 32, 3, '2017-11-22 12:18:07', 'Description\r\n\r\n\r\nBuilt in the twentieth century, Savrupson Heritage Haveli/Home is centrally located in the city of Jalandhar. It is a beautiful structure made of Rajasthani architecture.The Haveli has numerous antique artifacts lending an ethnic touch which will take you in the past era. It is surrounded by big lawns and dense tree plantation. An ideal place to stay and relax. Well suited for children to play and frolic. The adjoining dairy with farm animals will appeal to animal lovers. A quiet and peaceful place away from the noise and pollution of the city. Just 4 kilometers from the railway station and very close to the bus terminal. \r\n\r\n\r\nSpace\r\n\r\nSavrupson Heritage Haveli has big bedrooms with big balconies overlooking the surrounding greenery. Shipra and Dinesh along with a team of dedicated staff personally attend to guests who are treated as family. Warm conversations are our forte which no hotel can provide. Families with children will have access to maids. Great care is taken in the upkeep of bedrooms and washrooms. Delicious breakfast is served. Food lovers will love this place. Each bedroom has an attached washroom and accommodates two guests\r\n', NULL, 'SHIV VIHAR', '144003', '', 1, '1511962011878377584.jpg', '15119620111623455823.jpg', '15119620111619725474.jpg', '1511962011124895392.jpg', NULL, NULL, NULL, 5, '', '9', '', NULL, '', '', '', '', '', '', '', '2017-11-23 06:14:42', '2017-12-15 07:09:27', '', ''),
