(1177, 'Hema', 'Arora', '$2y$10$rGK3Zv4uoINuTm7CvO5Vyu/ewD8DWwNqujwb.dOTpyOtjdisH9T8u', '9599648844', '9999999999', '', 'Hema.arora@vresorts.in', 1, 'V Resorts', '', '', '', 'Logix Park, A-5, Ground Floor', '', 101, 1078, 38, 3, '2017-12-22 12:06:39', 'Founded in 2014 by Aditi Balbir, an ISB graduate, V Resorts is a new age travel solutions company that provides standardized boutique experiences in the leisure travel space. Giving our guests a taste of the local – and we''re not just talking food here – is the V Resorts way.\r\n\r\nPrimarily built on the concept of introducing the harried Indian traveller to new and unexplored places in the country, V Resorts is developing new destinations — and — ideas for tourism.\r\n\r\nToday, we have more than 100 properties spread across 17 Indian states. Balbir, who is the chief executive of V Resorts, conceptualised the business idea while conducting research for Bedrock Ventures. “When you expose urban travellers to unique travel experiences such as discovering the regional arts and crafts, indigenous food et all, awareness and appreciation grows, and it empowers the ''little India'', leading to the successful growth of the model,” she says.\r\n\r\nOur resorts'' standardised elements include V Canvas (aesthetically designed artworks that give a tantalising visual glimpse into what we offer); Spice Walk (our exclusive range of dining options that emphasize local and regional cuisines); Pitara (a range of items procured from local communities, packaged by us); V Unwind (in-house infotainment and leisure activities) and V Indulge (spas and massages to pamper our guests). While our corporate office is in Noida, the V Resorts family is truly spread across the length and breadth of the country, committed to finding new ways to delight our guests and customers.', NULL, 'Sector-16', '201301', NULL, 1, '151392497139762391.png', NULL, '15139249711951244038.jpg', '1513924971570840451.jpg', NULL, NULL, NULL, 0, '', '5', 'www.vresorts.in', NULL, '', '', '', '', '', '', '', '0000-00-00 00:00:00', '2017-12-26 05:32:59', '', ''),
