(11184, 333, 1214, 938, 'Greetings from ANDAMAN MEMORY MAKERS\n\n\n\nHere by sending you the Itinerary  for  5 nights and  6 days  (4 nights stay @ port blair and 1 night stay @ havelock on C.P plan.as per your requirement for 2 PAX FROM  FEB 2018 last week ONWARDS\n\n\n\n\n\nCOST OF PACKAGE For 2 PERSON  31,200/- (NINETEEN THOUSAND ONLY) ON C.P PLAN\n\nHOTEL CATEGORY :- \n\nHOTEL TANGO WAVES OR SIMILAR (PREMIUM ROOM) @ PORT BLAIR OR SIMILAR \n\n\n\n ELDOREDO BEACH  RESORT OR SIMILAR(STANDARD COTTAGE) @ HAVELOCK. OR SIMILAR \n\nPackage includes :-\n\n1.       Accommodation  1 A/C double beded room \n\n2.      C.P PLAN .( ALL BREAK FAST  )\n\n3.       All sightseeing (.a/c vehicle ) as per itinerary\n\n4.       All entry tickets \n\n5.       All boat tickets (  private ferry OR govt ferry ) for Havelock island AND NEIL ISLANDS \n\n6.       All parking charges\n\n7.       All taxes\n\n 8.    all transfers \n\n9.      All gsts\n\nEXCLUSSIONS :- ALL WATER SPORTS ACTIVITIES (SEA WALK , SCUBA DIVING , GLASS BOTTOM ) \n\nTour programme: - \n\nDay -1 :-  \n\n\n Arrival at Port Blair and transfer to respective hotel , start visit  to cellular jail followed by enthralling  light and sound show where the HEROIC SAGA of the INDIAN FREEDOM STUGGLE is brought alive .over night stay at respective hotel at port blair. \n\nDay 2 :- After breakfast proceed to HAVELOCK ISLANDS.\n\n Departure by ferry to HAVE LOCK ISLANDS  52 k.ms away from port blair. Havelock  Island sight seeing Beach no-7 on the western coast better known as RADHA NAGAR BEACH is one of the beautiful beaches of Havelock and was named as the “best beach in Asia “ by times of india 2004.overnight stay at repective hotel at havelock.\nDay 3 :- HAVELOCK to PORT BLAIRE via NEIL ISLAND\n\nISLAND TOUR COVERS BHARATHPUR BEACH , LAKSHMANPUR BEACH, NATURAL BRIDGE over night stay @ respective hotel @  port Blair\n\nDay 4 :- NORTH BAY CORAL REEF ISLAND AND ROSS ISLAND.\n\n   After breakfast followed to  NORTH BAY CORAL REEF ISLAND AND ROSS ISLAND. NORTH BAY CORAL REEF  ISLAND  an exotic varieties of beautiful  ornamental fish , corals and other marine life and clear water creates a breathtaking spectacle. From there to ROSS ISLAND the former residential and administrative island of the British during   their rule of the South East Asia was nick named THE PARIS OF THE EAST .this island was completely  destroyed in an earthquake now in ruins. You can see the deer walking by your side and the peoccks . over night stay at respective hotel at port blair.\n\n Day 5 :- After breakfast proceed to city tour\n\n1.CHATAM SAW MILL\n\n2. ANTHROPOLOGICAL MUSEUM\n\n3. SAMUDRIKA NAVEL MUSEUM \n\n4.FISHERIES\n\n5. SHOPPING  overnight stay @ respective hotel @ port Blair\n\n\n\nDay  6:- RETURN TO HOME WITH THE MEMORIES OF ANDAMAN\n\n\n\n\n\nNote :-\n\n1.      The company is no way shall be responsible for missing the flights , any loss or damage of individual belongings or bearings or improper connection with the transportation .caused by acts or strikes ,pilferage breakdown of machinery accidents acts or by natural calamities . All sightseeing depends upon permits , weather and road conditions.\n\n2.     Cancellation policy :- 30 days before the commencement of the tour 25% of the tour cost levied. 15 days before the commencement of the tour 50% of the tours cost will be levied. Less than 15 days before the commencement of the tour 75% of the tour cost will be levied. Less then 10 days before the commencement of the tour 100% of the tour cost will be levied. No refund is entitled for no shows.\n\n                                Please note that the above Reservation will be subject  to availability of hotels & availability of ferry tickets  and  according to the availability the quote may also change .please make a note of the same.\n\n\nRegards \n\n\n\nLakshmi\n\nAndaman Memory makers\n\nNayagaon , Royal housing colony , shadipur\n\nPort Blair, Andaman & Nicobar Islands  - 744106.\n\nCell :- 9933230178 , (watsup)9819396726 , 9531955356.\n\nMail :- Andaman.memorymakers24@gmail.com ,\n\n           Andaman.memorymakers2017@gmail.com \n\n', 1, '2018-01-16 05:11:28', '2018-01-16 05:10:37', 0, 0),
